import React from "react";
import { Container, Row, Col } from "react-bootstrap";

import Logo from "../Assests/Images/logo/logo.png";

function Resume() {
  return (
    <div className="resume mb-5" id="resume">
      <Container>
        <Row className="justify-content-center  text-center">
          <Col sm={12} md={10} lg={8}>
            <img src={Logo} class="img-fluid w-25" />
          </Col>
        </Row>

        <Row className="border-bottom border-dark">
        <p class="p-0 mx-0 mb-2 fs-6 fw-bold text-primary text-lg-start text-md-start text-center">Ariana Venti-Emily Wilson</p>

        </Row>
      </Container>
    </div>
  );
}

export default Resume;
